import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return (
      <nav className='bg-slate-50'>
        <a className='text-3xl' href="">mohtiji</a>
        <ul>
            <li><a href="">Home</a></li>
        </ul>


      </nav>
    )
  }
}
